import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <>
      <div className="jumbotron">
        <div className="heading">Git Repositories</div>
        <div className="subHeading">
          A dashboard for top 100 repositories based on Github Stars
        </div>
      </div>
    </>
  );
};

export default Header;
